'use strict';

var _sense_editor_resize = require('../sense_editor_resize');

var SenseEditor = require('../sense_editor/editor');
var exampleText = require('raw-loader!./helpExample.txt').trim();


require('ui/modules').get('app/sense').directive('senseHelpExample', function (Private) {
  var useResizeChecker = Private(_sense_editor_resize.useResizeCheckerProvider);

  return {
    restrict: 'E',
    link: function link($scope, $el) {
      $el.text(exampleText);
      $scope.editor = new SenseEditor($el);
      useResizeChecker($scope, $el, $scope.editor);
      $scope.editor.setReadOnly(true);
      $scope.editor.$blockScrolling = Infinity;

      $scope.$on('$destroy', function () {
        if ($scope.editor) $scope.editor.destroy();
      });
    }
  };
});
